  `type_n` int NOT NULL DEFAULT 0 COMMENT '默认为0，就是单条消息模式，为1就是截至这个消息id都不能看，一个用户某room只允许存在一个为1的',
  `user_id` bigint NOT NULL,
  `room_id` bigint NOT NULL COMMENT '冗余设计，方便查',
  `msg_id` bigint NOT NULL COMMENT '用户操作的哪条消息',
  `state` int NOT NULL DEFAULT 1 COMMENT '1为删除，如果为0不管跟不存在一样,0这种清空不应该出现',
