  `id` bigint NOT NULL COMMENT '班次id',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '班次名称',
  `every_day` int NOT NULL DEFAULT 1 COMMENT '一天几次上下班',
  `rules` json NOT NULL COMMENT '具体上下班规则',
  `bak` int NOT NULL DEFAULT 0 COMMENT '班次管理没有修改，删除和更新都是假的，都是新增，加个标记，删除和更新不让查看而已,为1就是冗余，方便统计数据',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = DYNAMIC;

