  `user_id` bigint NOT NULL COMMENT '绑定用户id',
  `student_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '冗余学号',
  `signin_time` datetime NOT NULL COMMENT '签到时间',
  `signin_device_id` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '来源设备，可能为空，补签的方式为空',
