  `signin_image` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '签到原始图,base64，face方式才有',
  `update_user` bigint NULL DEFAULT NULL COMMENT '操作记录id，只有当人工操作数据才会有此项',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '操作备注',
