  `log_datetime` date NOT NULL COMMENT '哪一天的记录',
  `state` int NOT NULL COMMENT '状态,0正常，1为迟到，2为早退',
  `bc_count` int NOT NULL COMMENT '第几个班次',
  `start_end` int NOT NULL COMMENT '0为上班，1为下班',
  `log_time` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '当天具体签到时间字符串,可能不存在',
  `from_log` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '来源原始记录',
  `state_time` int NULL DEFAULT NULL COMMENT '状态时间，例如早退多少分钟',
