  `new_state` int NOT NULL,
  `update_user` bigint NOT NULL COMMENT '操作人',
  `update_time` datetime NOT NULL COMMENT '取最新的时间的生效',
  PRIMARY KEY (`id`, `signin_log_cli_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = DYNAMIC;

