DROP TABLE IF EXISTS `signin_renewal`;
CREATE TABLE `signin_renewal`  (
  `id` bigint NOT NULL COMMENT '补签表主键',
  `user_id` bigint NOT NULL COMMENT '补签用户id',
  `renewal_time` datetime NOT NULL COMMENT '补签时间点，与打卡时间功能一致',
  `renewal_reason` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '补签理由，有就展示，没有就空着',
  `create_time` datetime NOT NULL COMMENT '补签发起时间',
  `signin_log_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '补签成功，必定会生成一条log记录，且不允许补签未来的时间！只能补签已经过去的时间',
  `renewal_about_act_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '补签流程发起必须携带所有相关项的实例id,后续流程结束时方便更新状态',
  `state` int NOT NULL DEFAULT 1 COMMENT '当前补签状态，1为通过，0为流程中，2为拒绝',
